import Details from './components/Details'
import Exercises from './components/Exercises';
import { Routes, Link, Route } from 'react-router-dom';
import './App.css';


function App() {
  return (
    <div className="App">
      {/* <Switch> */}
      <Routes>
        <Route path="/details/:id">
          <Details />
          </Route>
        <Route path="/">
        <Exercises />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
